import React from 'react';
import { Field } from 'redux-form';


const Login = () => {
    return (
        <>
            <form>
                <Field
                    name="email"
                    label="Email*"
                    type="email"
                    placeholder="Email"
                    component={this.renderField}
                />
            </form>
        </>
    )
}

export default Login
